import React from "react"

export default function ConfidentList(props) {

    const confidentId = (
        <div>
            {props.quotes.map((quote) =>
                <p key={quote.id}>
                    {quote.id}
                </p>
            )}
        </div>
    )
    const confidentQuote = (
        <div>
            {props.quotes.map((quote) =>
                <p key={quote.id}>
                    {quote.url}
                </p>
            )}
        </div>
    )
    return (
        <div>
            {confidentId}
            {confidentQuote}
        </div>
    )
}
